        },
        {
            "code": "PT_FAQ_QUES_TWO",
            "message": "Why ULBs levy property taxes?",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "PT_FAQ_QUES_THREE",
            "message": "Why we as property owners should pay it?",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "PT_FAQ_ANS_ONE",
            "message": "A building or a open plot under the usage of residential or non-residential purposes are considered as property. ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "PT_FAQ_ANS_TWO",
            "message": "ULBs perform certain obligatory functions in its boundary limit and need money to carry out those functions hence the body levy the tax on buildings and open plots.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "PT_FAQ_ANS_THREE",
            "message": "We should pay the property tax timely to enable the ULB to keep the city neat and clean, perform maintenance work and other functions.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_S",
            "message": "FAQs",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_QUES_ONE",
            "message": "How do I renew my Trade License? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_QUES_TWO",
            "message": " How do I search for my application? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_QUES_THREE",
            "message": "How can I download Trade License Certificate or payment receipts? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_ANS_ONE",
            "message": "You can renew trade licenses at the counter or through the portal. After logging in, search for the relevant trade license in the portal. Then click on link for the trade license that you wish to renew. Next, complete the application for the renewal of Trade License and click submit.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_ANS_TWO",
            "message": "You can search for your previous applications by clicking on My Applications in the home screen. Then click on the relevant application card among the list.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_ANS_THREE",
            "message": "After you login with your credentials, click on my application. Among all the applications listed, find the one for which status is 'approved' and click on 'View Details'. In the next page, click on the 'Download' button on top right corner. In case of approved applications, TL certiifcate and Payment Receipt will be show in the drop down and click on the relevant one to download.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "TL_FAQ_ANS_THREE_APP_ACKNOWLEDGE",
            "message": "In case application is under processing, then you can download an Application Acknowledgement through same methodology.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_S",
