        },
        {
            "code": "MCOLLECT_FAQ_QUES_ONE",
            "message": "What is a Challan? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_QUES_TWO",
            "message": "What is validity period for a challan?",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_QUES_THREE",
            "message": "Can the challan be paid online?",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_ANS_ONE",
            "message": "Challan is a demand notice issued to the citizen for availing the service of the governing body. Challan can be paid for categories like advertising fees, marriage hall booking etc.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_ANS_TWO",
            "message": "The timeline within which the challan amount has to be paid. This is usually decided by the governing body.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "MCOLLECT_FAQ_ANS_THREE",
            "message": "Yes. Challans can be paid online or at the counter. Please use the challan reference number or phone number to seach for the challan & pay online.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
