            "message": "FAQs",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_QUES_ONE",
            "message": "What happens when eDCR scrutiny fails? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_QUES_TWO",
            "message": "How do I renew my permit? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_QUES_THREE",
            "message": "How does eDCR Scrutiny works and how much time it takes to get the diagrams scrutinized? ",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_ANS_ONE",
            "message": "When an eDCR scrutiny fails, the error information is marked across each line item in the output file. The architect can make the corrections accordingly and resubmit the plan real time. This can be done any number of times without incurring any additional charges.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_ANS_TWO",
            "message": "You can renew permits at the counter or through the portal. After logging in, search for the relevant permit application in the portal. Then click on link for the permit that you wish to renew. Next, complete the application for the renewal of permit and click submit.",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
        {
            "code": "BPA_FAQ_ANS_THREE",
            "message": "The eDCR scrutiny system compares the parameters in the drawings against the by laws set in the corresponding administrative region and evaluates if they are violating. In the output file, against each paramter that is evaluated, there will be an indication to show if that is approved or rejected. The entire scrutiny process takes ~5 seconds",
            "module": "rainmaker-common",
            "locale": "en_IN"
        },
